import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Navbar} from 'react-bootstrap';
import  './Page.css';
import { Link } from "react-router-dom";

/*import {Container} from 'react-bootstrap';*/



function LeftNav(){


    return(
        <div>
            <div className="div1-leftnav">



                     <Link to="/Lien1">LIEN 1 INTERNE </Link> 

                     <Link to="/Lien2">LIEN 2 INTERNE </Link>

                     <Link to="/Lien3">LIEN 3 INTERNE </Link>


                     <Link to="/Lien4">LIEN 4 INTERNE </Link>


                <Navbar.Brand href="https://www.wikipedia.com">  LIEN 1 EXTERNE  </Navbar.Brand>


                <Navbar.Brand href="https://www.google.com">  LIEN 1 EXTERNE  </Navbar.Brand>

            </div>


        </div>
      );
      }

export default LeftNav;
